// Estilos
import './App.scss';
// Sistema de Routeo
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';

function App() {
  return (
    <Router>
       <div className="app">
        <h1>Estamos en App</h1>
        <link to="/">Admin</link>
        <link to="/contact">Contactos</link>
        <link to="/singin">Sign In</link>


        {/* <Route exact path="/" component={<Admin/>}/>  
        <Admin />
